import React ,{Component}from 'react';
import './App.css';


class App extends Component {
 username = useFormInput('')

 render(){ return (
   <div>
  Login<br /><br />
  <div>
    Username<br />
    <input type="text"  {...username} autoComplete="new-password" />
  </div>

  </div>);
}
}

export default App;
